import React from 'react';
import logo from './logo.svg';
import './App.css';
import axios from "axios";

class App extends React.Component {
  constructor() {
    super()
    this.state = {}
  }

  componentDidMount() {

    axios.get("https://randomuser.me/api/?results=200&nat=us&gender=female")
      .then((responce) => {
        this.setState({});
      })
  }

  render() {
    return (
      <div className="App" >
        <p>hello world</p>
      </div>
    );
  }

}

export default App;
